import { InputText } from 'primereact/inputtext';
import {Password} from 'primereact/password';
import "../App.css"

function Login() {
    return (
        <div className="login-container">
            <span className="p-float-label">
                <InputText id="in"/>
                <label htmlFor="in">Username</label>
            </span>
            <Password  icon/>
        </div>
    );
}

export default Login
